window.bookSummaryJSON = "<p><b>A vengeful witch. A shattered family. A dark threat.</b></p> <p>When her estranged brother Kyle finally reaches out, Alice will do everything in her power to help, even if it goes against everything she’s ever believed in.</p> <p>When Kyle’s fractured past comes to light, Alice realises they are both hunting the same target. The very man who betrayed their family.</p> <p>Riley Storm is piecing together his fathers deceptions. It was his burden to find him, and to avenge the many who his father has murdered. But it wasn’t as easy as he thought. Not when Mason Storm has gone underground.</p> <p>Brought together by a common goal, Alice and Riley are forced to work together, all the while protecting her brother Kyle. For Riley is trained to destroy everything deemed dangerous, and Kyle is dangerous.</p> <p><b>Rogue's Mercy is the third instalment in the nail-biting action packed urban fantasy series Alice Skye by Taylor Aston White. Follow Alice as she battles her daemons and unveils dark secrets in the modern world of magic.</b></p> <p><i>Disclaimer: This novel is written in British English including spelling and grammar.</i></p>"; 
